import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';


function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Home />
        <R>
          <Route exact path="/" />
        </R>
      </Router>
    </>
  );
}

export default App;
